import React from "react";

const SetLeft = ({setCom}) => {
  return (
    <>
      <div className="">
        <div className="adminNav">
          <ul>
            <li onClick={()=>{setCom("dashboard")}}><i className="fa fa-bar-chart me-2"></i>Dashboard</li>
            <li onClick={()=>{setCom("profile")}}><i class="fa fa-user" aria-hidden="true"></i>Profile</li>
            <li onClick={()=>{setCom("api")}}><i class="fa fa-globe" aria-hidden="true"></i>Api's</li>
            <li onClick={()=>{setCom("users")}}>Users</li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default SetLeft;
